import React from "react";
import Avatar from "react-avatar";

const Contact = ({ contact }) => {
  const { name, phone, email } = contact;
  return (
    <tr>
      <td>
        <div className="form-check">
          <input
            className="form-check-input"
            type="checkbox"
            value=""
            id="flexCheckDefault"
          />
          <label className="form-check-label" for="flexCheckDefault"></label>
        </div>
      </td>
      <td>
        <Avatar className="mr-2" name={name} size={40} round={true} />
        {name}
      </td>
      <td>{phone}</td>
      <td>{email}</td>
      <td>
          <a href="#"><span className="material-icons">edit</span></a>
          <a href="#"><span className="material-icons">remove</span></a>
      </td>
    </tr>
  );
};
export default Contact;
